OSBuild accepts two versions of manifests. Both manifests are plain JSON files. The following sections contain examples of both (note that comments are not allowed in JSON, so the examples below are not actually valid JSON) . Version 1 The version 1 manifest is built around the idea that an artifact is produced by downloading files from the Internet (e.g. RPMs), using them to build and modify a filesystem tree (using stages), and finally using a read-only version of the final filesystem tree as an input to a assembler which produces the desired artifact. { # This version contains 2 top-level keys. # First sources, these get downloaded from a network and are available # in the stages. "sources": {}, # Second is a pipeline, which can optionally contain a nested "build" # pipeline. "pipeline": { # The build pipeline is used to create a build container that is # later used for building the actual OS artifact. This is mostly # to increase reproducibility and host-guest separation. # Also note that this is optional. "build": { "pipeline": { "stages": [ { "name": "", "options": {} }, { "name": "", "options": {} } ], "runner": "" } }, # The pipeline itself is a list of osbuild stages. "stages": [ { "name": "", "options": {} }, { "name": "", "options": {} } ], # And finally exactly one osbuild assembler. "assembler": { "name": "", "options": {} } },
} Version 2 Version 2 is more complicated because OSBuild needed to cover additional use cases like OSTree commit inside of a OCI container. In general that is an artifact inside of another artifact. This is why it comes with multiple pipelines. { # This version has 3 top-level keys. # The first one is simply a version. "version": "2", # The second one are sources as in version 1, but keep in mind that in this # version, stages take inputs instead of sources because inputs can be both # downloaded from a network and produced by a pipeline in this manifest. "sources": {}, # This time the 3rd entry is a list of pipelines. "pipelines": [ { # A custom name for each pipeline. "build" is used only as an example. "name": "build", # The runner is again optional. "runner": "", "stages": [ { # The "type" is same as "name" in v1. "type": "", # The "inputs" field is new in v2. You can specify what goes to # the stage. Example inputs are RPMs and OSTree commits from the # "sources" section, but also filesystem trees built by othe # pipelines. "inputs": {}, "options": {} } ] }, { # Again only example name. "name": "build-fs-tree", # But this time the pipeline can use the previous one as a build pipeline. # The name:<something> is a reference format in OSBuild manifest v2. "build": "name:build", "stages": [] }, { "name": "do-sth-with-the-tree", "build": "name:build", "stages": [ { "type": "", "inputs": { # This is an example of how to use the filesystem tree built by # another pipeline as an input to this stage. "tree": { "type": "org.osbuild.tree", "origin": "org.osbuild.pipeline", "references": [ # This is a reference to the name of the pipeline above. "name:build-fs-tree" ] } }, "options": {} } ] }, { # In v2 the assembler is a pipeline as well. "name": "assembler", "build": "name:build", "stages": [] } ]
}
